msg:
Automatic Content-Type for FormData uploads

When data passed to axios is of type FormData we have to let the browser
create the Content-Type header so that the boundaries will get right
etc.

Usage:

```js
var data = new FormData();
data.append('field', 'some string');
data.append('file', someFile);

var opts = {
  transformRequest: function(data) { return data; }
};

axios.post('/fileupload', data, opts);

```

Updating typings

The first argument in `axios.interceptors.response.use` is optional, in the case that you just want to intercept an error.

Ex:

```ts
axios.interceptors.response.use(undefined, error => {
...
});
```

Make redirection from HTTP to HTTPS work (#2426)

When calling an HTTP resource redirecting to a HTTPS one with a keepAlive agent. We get the following error:
```
TypeError [ERR_INVALID_PROTOCOL]: Protocol "https:" not supported. Expected "http:"
    at new ClientRequest (_http_client.js:119:11)
    at Object.request (https.js:281:10)
    at RedirectableRequest._performRequest (/Users/jthomassey/projects/ecom-shop-web/node_modules/follow-redirects/index.js:169:24)
    at RedirectableRequest._processResponse (/Users/jthomassey/projects/ecom-shop-web/node_modules/follow-redirects/index.js:260:10)
    at ClientRequest.RedirectableRequest._onNativeResponse (/Users/jthomassey/projects/ecom-shop-web/node_modules/follow-redirects/index.js:50:10)
    at Object.onceWrapper (events.js:277:13)
    at ClientRequest.emit (events.js:189:13)
    at HTTPParser.parserOnIncomingClient [as onIncoming] (_http_client.js:556:21)
    at HTTPParser.parserOnHeadersComplete (_http_common.js:109:17)
    at Socket.socketOnData (_http_client.js:442:20)
```

This can be tested here : 
```
const http = require('http');
const https = require('https');
const axios = require('axios');

axios.get('http://www.photobox.fr', { httpAgent: http.Agent({ keepAlive:true }), httpsAgent: https.Agent({ keepAlive:true }) })
  .then(response => {
    console.log(response);
    console.log(response.headers);
  })
  .catch(error => {
    console.log(error);
  });
```

Axios delegate the redirection to the follow-redirect package which accept an option `agents` for both http and https agent see : https://github.com/follow-redirects/follow-redirects#per-request-options

Verify computed property dependencies

Improves the validator to fail if someone forgets to declare
dependent properties for computed state:

```
export default {
  computed: {
    bar: () => { return new Date().getTime(); }
  }
};
```

@parcel/config-default: Require referenced modules as dependencies (#2854)

* @parcel/config-default: add a test to verify dependencies

* List default resolver and runtime as default config deps

Fix for malformed output.

Without this change, you can get malformed stuff like this:

  var foo = function() {
    return "foo";
  }var bar = function() {
    return "bar";
  }

By introducing a newline, a semicolon is implicitly inserted between statements
when necessary:

  var foo = function() {
    return "foo";
  }
  var bar = function() {
    return "bar";
  }

The indentation as a result of this commit is off, but I’m not sure how to fix
it because the build fails for me. (I tested this by editing dist directly.)

Allow undefined import in interop

Most interopts I've seen, babel, webpack, and rollup's [cjs interop](https://github.com/rollup/rollup/blob/master/src/finalisers/cjs.js#L42) check for the existence of the imported value prior to checking for `default`.

I tried to read the ecma specs but they're pretty confusing.  Is this expected to throw an error?

```js
import foo from 'file-does-not-exist';

// or would it just be undefined?
foo === undefined;
```

Even _if_ it would throw an error in ES2015 modules, if I know my target is UMD anyways, why not allow it to import without an error?
